import { BrowserRouter, Routes, Route } from 'react-router-dom';
//BrowserRouter: 

function App() {
  return 
  <BrowserRouter>//connects to the browser
    <Routes> //parent for all our routes
      <Route path="/" element={<div>home page</div>} />
      <Route path="testing" element={<div>
        <h2>testing</h2>
      </div>} />
    </Routes>
  </BrowserRouter>
}

export default App;
